const Skills = ({nomEntreprise,contrat,metier,dateDeDebut,dateDeFin}) => {
    return (
        <>
            <article class="rounded-lg border border-gray-100 bg-white p-4 shadow-sm transition hover:shadow-lg sm:p-6">
            <a href="/">
                <h3 class="mt-0.5 text-lg font-medium text-gray-900"> {nomEntreprise} - {contrat} </h3>
            </a>

            <p class="mt-2 line-clamp-3 text-sm/relaxed text-gray-500"> {metier} / {dateDeDebut} - {dateDeFin} </p>

            </article>
            <p>
                <strong>Entreprise:</strong> {nomEntreprise}
            </p>
            <p>
                <strong>Contrat:</strong> {contrat}
            </p>
            <p>{metier}</p>
            <p>{dateDeDebut} - {dateDeFin}</p>
        </>
    );
};

export default Skills;
